import { Autocomplete, Grid, TextField } from "@mui/material";
import { IMovie } from "../interfaces/movieInterface";
import movieImage from "../images/movieIMG.jpeg";
import { Link } from "react-router-dom";
import { height } from "@mui/system";
export const SearchBar = () => {
  const [suggestions, setSuggestions] = useState();
  const [open, setOpen] = useState(false);
  const [movieData, setMovieData] = useState<IMovie[]>([
    {
      id: 100,
      title: "Iron pony",
      description: "asdklfjsalkjdf",
      rating: 2,
      numberOfVotes: 1,
    },
    {
      id: 200,
      title: "Spaceglider",
      description: "space gliding monkeys",
      rating: 10,
      numberOfVotes: 3,
    },
  ]);

  const handleSelect = (event: any, value: any) => {
    console.log(value);
    //Route to movie page
  };

  return (
    <>
      <Autocomplete
        freeSolo
        id="free-solo"
        disableClearable
        autoHighlight
        open={open}
        onOpen={() => setOpen(true)}
        onClose={() => setOpen(false)}
        onChange={() => setOpen(false)}
        sx={{ width: 600 }}
        options={movieData}
        getOptionLabel={(option) => option.title}
        // renderOption={(props, option) => (
        //   <div style={{ cursor: "pointer" }}>
        //     <Grid container spacing={2}>
        //       <Grid item>
        //         <img src={movieImage} width="50px" height="50px" />
        //       </Grid>
        //       <Grid item spacing={0}>
        //         {option.title}
        //       </Grid>
        //     </Grid>
        //   </div>
        // )}
        renderOption={(props, option) => (
          <div>
            <Link
              style={{ width: "100%", height: "100%" }}
              to={{
                pathname: `/movie/${option.id}`,
                state: option,
              }}
            >
              {option.title}
            </Link>
          </div>
        )}
        renderInput={(params) => (
          <TextField
            {...params}
            label="Movie"
            InputProps={{
              ...params.InputProps,
              type: "search",
            }}
          />
        )}
        //onChange={(event, value) => handleSelect(event, value)}
      />
    </>
  );
};
